window.bookSummaryJSON = "<p><b>You know your Gaia link is broken when your match is 93.</b> </p> <p>While every Vetusian around me is expecting the arrival of the first hybrids, my mate is living out her final days in a nursing home. </p> <p>With true love unattainable, I concentrate on busting the crime ring responsible for the supply of human females forced into prostitution at the Odheim brothels. </p> <p>As a CAT officer, it’s my job to keep Earth women from being abducted. Until the department for interspecies relations offers me a breeding contract with one of them. </p> <p>When Rosita wants to make coin carrying out a hybrid child, I’m happy to help. But things change when I find out what she needs those Imperial Credits for. Now she needs my protection, and so will that child I intend to plant in her womb. </p> <p><i>Mated </i>is the third book in this alien invasion romance series, following a couple strong enough to defy fate. If you enjoy strong women, devoted aliens, fated mates, and hard-earned happily ever afters with no cliff-hangers, you’ll love Garrison Earth. </p> <p><b>Author's note: </b>The entire Garrison Earth series touches on subjects such as captivity, drug abuse, forced prostitution, loss of loved ones, human trafficking, rough handling, and violence. Any listener uncomfortable with the harsh realities of an alien invasion should please consider before purchase.</p>"; 
